import React from 'react';
import './App.css'; // You can import your CSS if needed
import { GitHubRepoURL, GitHubAvatar } from './github_data';

const userInfo = {
  repoUrl: 'https://github.com/thanapornjanbuala',
  avatarUrl: 'https://avatars.githubusercontent.com/u/96261980?v=4',
  alt: 'thanapornjanbuala', // Corrected the property name
};

function App() {
  return (
    <div className="App">
      <h1>{userInfo.alt}</h1> {/* Corrected the parentheses */}
      <GitHubAvatar avatarUrl={userInfo.avatarUrl} alt={userInfo.alt} size={200} /> {/* Corrected the property name */}
      <GitHubRepoURL repoUrl={userInfo.repoUrl} /> {/* Corrected the property name */}
    </div>
  );
}

export default App;
